# 461. Hamming Distance
# nTrials: 2
# Didn't notice that 0 digit doesn't count 
# when one number has more bits than the other

# Solution 1: The straightforward solution by comparing
# digits. Note the missing 0 digits should be filled.
class Solution(object):
    def hammingDistance(self, x, y):
        """
        :type x: int
        :type y: int
        :rtype: int
        """
        count = 0
        while x > 0 and y > 0:
            digit1 = x % 2
            digit2 = y % 2
            count += abs(digit1 - digit2)
            x //= 2
            y //= 2
        else:
            if x == 0:
                while y > 0:
                    count += y % 2
                    y //= 2
            else:
                while x > 0:
                    count += x % 2
                    x //= 2
        return count

sol = Solution()
sol.hammingDistance(1, 4)

# Solution 2: Found in the forum, neat and concise.
# Need to develop this type of tricky solution.
class Solution(object):
    def hammingDistance(self, x, y):
        """
        :type x: int
        :type y: int
        :rtype: int
        """
        return bin(x^y).count('1')  # x^y

sol = Solution()
sol.hammingDistance(1, 4)


class Solution(object):
    def findWords(self, words):
        """
        :type words: List[str]
        :rtype: List[str]
        """
        def f(x):
            if x.lower() in 'qwertyuiop':
                return 1
            elif x.lower() in 'asdfghjkl':
                return 2
            elif x.lower() in 'zxcvbnm':
                return 3
        return [word for word in words if len(set(map(f, word)))==1]

sol = Solution()
words = ["Hello", "Alaska", "Dad", "Peace"]
sol.findWords(words)




class Solution(object):
    def findMaxConsecutiveOnes(self, nums):
        """
        :type nums: List[int]
        :rtype: int
        """
        cnt = 0
        ans = 0
        for num in nums:
            if num == 1:
                cnt += 1
                ans = max(ans, cnt)
            else:
                cnt = 0
        return ans

# 506. Relative Ranks
class Solution(object):
    def findRelativeRanks(self, nums):
        """
        :type nums: List[int]
        :rtype: List[str]
        """
        return [str(i[0]+1) if i[0] > 2 else ['Gold Medal', 'Silver Medal', 'Bronze Medal'][i[0]] for i in sorted(enumerate(sorted(enumerate(nums), key=lambda x: x[1], reverse=True)), key=lambda x:x[1][0])]



# 492. Construct the Rectangle
class Solution(object):
    def constructRectangle(self, area):
        """
        :type area: int
        :rtype: List[int]
        """
        w = int(math.sqrt(area))
        while area % w != 0:
            w -=1
        else:
            return [area//w, w]

sol = Solution()
area = 5
sol.constructRectangle(area)


