# 125. Valid Palindrome
class Solution(object):
    def isPalindrome(self, s):
        """
        :type s: str
        :rtype: bool
        """
        s0 = [c.lower() for c in s if c.lower().isalnum()]  # isalhum, isalpha, isnumeric
        if len(s0) <= 1: return True
        i, j = 0, len(s0)-1
        while i <= j:
            if s0[i] != s0[j]:
                return False
            i += 1
            j -= 1
        return True

